/* globals $:false */
var width = $(window).width(),
    height = $(window).height(),
    isMobile = false,
    $window = $(window);
$(function() {
    $.fn.isOnScreen = function() {
        var win = $window;
        var viewport = {
            top: win.scrollTop(),
            left: win.scrollLeft()
        };
        viewport.right = viewport.left + width;
        viewport.bottom = viewport.top + height;
        var bounds = this.offset();
        bounds.right = bounds.left + this.outerWidth();
        bounds.bottom = bounds.top + this.outerHeight();
        return (!(viewport.right < bounds.left || viewport.left > bounds.right || viewport.bottom < bounds.top || viewport.top > bounds.bottom));
    };
    var app = {
        init: function() {
            $(window).resize(function(event) {
                app.sizeSet();
            });
            $(document).ready(function($) {
                $body = $('body');
                $opening = $('.opening');
                $logoImg = $('header .logo img');
                $logoImgOrig = $logoImg.data('logo');
                $logoAnim = "data:image/gif;base64,";
                $introWords = $('.intro.title');
                $ajaxContainer = $('#lightbox .inner');
                $mobileMenu = $('nav.mobile-menu');
                $featured = $('.featured-project #video').get(0);
                History.Adapter.bind(window, 'statechange', function() {
                    var State = History.getState();
                    console.log(State);
                    var content = State.data;
                    if (content.type == 'project') {
                        $body.addClass('project');
                        $featured.pause();
                        app.loadContent(State.url, $ajaxContainer);
                    } else {
                        $body.removeClass('project lightbox');
                        setTimeout(function() {
                            var $frame = $('#video-player iframe');
                            $frame.attr('src', '');
                            $ajaxContainer.empty();
                            $('#lightbox .more').removeClass('open');
                            $featured.play();
                        }, 500);
                    }
                });
                //esc
                $(document).keyup(function(e) {
                    if (e.keyCode === 27) app.goIndex();
                });
                //left
                $(document).keyup(function(e) {
                    if (e.keyCode === 37 && $slider) app.goPrev($slider);
                });
                //right
                $(document).keyup(function(e) {
                    if (e.keyCode === 39 && $slider) app.goNext($slider);
                });
                $('body').on('click', '[data-target]', function(e) {
                    $el = $(this);
                    e.preventDefault();
                    if (!isMobile) {
                        if ($el.data('target') == "project") {
                            History.pushState({
                                type: 'project'
                            }, $el.data('title') + " | " + $sitetitle, $el.attr('href'));
                        } else if ($el.data('target') == "index") {
                            e.preventDefault();
                            app.goIndex();
                        }
                    } else {
                        window.location.href = $el.attr('href');
                    }
                });
                $opening.click(function(event) {
                    app.loadHome();
                });
                setTimeout(app.loadHome, 4000);
                if (!$.cookie("intro")) {
                    app.createCookie('intro', 'seen', 30);
                }
                $logoImg.hover(function() {
                    $logoImg.attr('src', $logoAnim);
                }, function() {
                    $logoImg.attr('src', $logoImgOrig);
                });
                $('.menu-toggle').click(function(e) {
                    e.preventDefault();
                    $mobileMenu.addClass('is-visible');
                });
                $mobileMenu.find('.close').click(function(e) {
                    e.preventDefault();
                    $mobileMenu.removeClass('is-visible');
                });
                $(".project").hover(app.hoverVideo, app.hideVideo);
                $('.quotes').slick({
                    dots: true,
                    arrows: false,
                    fade: true,
                    adaptiveHeight: true,
                    autoplay: true,
                    speed: 500
                });
                $("#lightbox, #lightbox .close").click(function(e) {
                    e.preventDefault();
                    app.goIndex();
                }).children().click(function(e) {
                    return false;
                });
                $('#lightbox .more').click(function(e) {
                    e.preventDefault();
                    $('#project-details').slideToggle(function() {
                        if ($(this).is(':visible')) {
                            $('#lightbox').animate({
                                scrollTop: $('#project-details').offset().top - height / 2
                            }, 1000);
                        }
                    });
                    $(this).toggleClass('open');
                });
                $window.load(function() {
                    app.sizeSet();
                    $(".loader").fadeOut("fast");
                    if ($('#numbers .num').size() > 0) {
                        $window.scroll(function(event) {
                            $('#numbers .num:not(".triggered")').each(function(index, el) {
                                if ($(this).isOnScreen()) {
                                    $(this).addClass('triggered').prop('number', ($(this).data('number') - 20).toString()).animateNumber({
                                        number: $(this).data('number')
                                    }, 3000);
                                }
                            });
                        });
                    }
                    if (!$opening.is(":visible")) {
                        $("#js-words").Morphext({
                            animation: "flipInX",
                            separator: ",",
                            speed: 1000
                        });
                    }
                    app.parallax();
                });
            });
        },
        sizeSet: function() {
            width = $(window).width();
            height = $(window).height();
            if (width <= 770) isMobile = true;
            if (!isMobile) {
                $logoPos = $logoImg.offset().left;
                $introWords.css('padding-left', $logoPos * (1 + 0.068));
            } else {
                $introWords.attr('style', '');
                if (width >= 770) {
                    location.reload();
                }
            }
        },
        createCookie: function(name, value, minutes) {
            var date = new Date();
            date.setTime(date.getTime() + (minutes * 60 * 1000));
            $.cookie(name, value, {
                expires: date
            });
        },
        loadHome: function() {
            $("#js-words").Morphext({
                animation: "flipInX",
                separator: ",",
                speed: 1000
            });
            $opening.fadeOut('500');
        },
        hoverVideo: function(e) {
            $('video', this).get(0).play();
        },
        hideVideo: function(e) {
            var video = $('video', this).get(0);
            video.pause();
            video.currentTime = 0;
        },
        goIndex: function() {
            History.pushState({
                type: 'index'
            }, $sitetitle, $root);
        },
        parallax: function() {
            if (!isMobile) {
                var controller = new ScrollMagic.Controller();
                var featured = TweenLite.fromTo('.featured-project #video', 1, {
                    yPercent: 10,
                }, {
                    yPercent: 0,
                });
                var projects = TweenMax.staggerFromTo(".project", 2, {
                    y: '30%',
                    opacity: 0
                }, {
                    y: '0%',
                    opacity: 1
                }, 0.3);
                var founders = TweenMax.staggerFromTo("#founders article", 2, {
                    y: '20%',
                    opacity: 0
                }, {
                    y: '0%',
                    opacity: 1
                }, 0.3);
                var team = TweenMax.staggerFromTo("#team article", 2, {
                    y: '20%'
                }, {
                    y: '0%',
                }, 0.5);
                new ScrollMagic.Scene({
                    triggerElement: ".featured-project",
                    triggerHook: 0.4,
                    duration: '100%'
                }).setTween(featured).addTo(controller);
                new ScrollMagic.Scene({
                    triggerElement: ".projects",
                    triggerHook: 0.6,
                    duration: '60%'
                }).setTween(projects).addTo(controller);
                new ScrollMagic.Scene({
                    triggerElement: "#founders",
                    triggerHook: 0.55,
                    duration: '50%'
                }).setTween(founders).addTo(controller);
                new ScrollMagic.Scene({
                    triggerElement: "#team",
                    triggerHook: 0.6,
                    duration: '100%'
                }).setTween(team).addTo(controller);
                var $elements = document.querySelectorAll('section.parallax-slide .content');
                if ($elements.length > 0) {
                    var pos;
                    var wipeAnimation = new TimelineMax();
                    for (var i = 1; i < $elements.length; i++) {
                        var el = $elements[i];
                        var anim = el.getAttribute('data-wipe');
                        if (anim == 'right') {
                            wipeAnimation.add(TweenLite.fromTo(el, 1, {
                                    x: "120%"
                                }, {
                                    x: "0%",
                                    ease: Linear.easeNone
                                }) // in from right
                            );
                        } else if (anim == 'left') {
                            wipeAnimation.add(TweenLite.fromTo(el, 1, {
                                    x: "-120%"
                                }, {
                                    x: "0%",
                                    ease: Linear.easeNone
                                }) // in from left
                            );
                        } else if (anim == 'top') {
                            wipeAnimation.add(TweenLite.fromTo(el, 1, {
                                    y: "-120%"
                                }, {
                                    y: "0%",
                                    ease: Linear.easeNone
                                }) // in from top
                            );
                        } else if (anim == 'bottom') {
                            wipeAnimation.add(TweenLite.fromTo(el, 1, {
                                    y: "120%"
                                }, {
                                    y: "0%",
                                    ease: Linear.easeNone
                                }) // in from bottom
                            );
                        }
                    }
                    new ScrollMagic.Scene({
                        triggerElement: "#pin-container",
                        triggerHook: 'onLeave',
                        duration: $elements.length * 100 + "%"
                    }).setPin("#pin-container").setTween(wipeAnimation).addTo(controller);
                }
            } else {
                $('#pin-container').slick({
                    dots: false,
                    arrows: false,
                    fade: false,
                    autoplay: true,
                    speed: 500,
                    autoplaySpeed: 2000
                });
            }
        },
        loadContent: function(url, target) {
            console.log('load');
            target.load(url + ' #wrapper', function(response) {
                $("body iframe").on("load", function() {
                    app.centerContainer();
                    $body.addClass('lightbox');
                });
            });
        },
        ajaxLoadContent: function(url, target) {
            $.ajax({
                url: url,
                success: function(data) {
                    $(target).html(data);
                }
            });
        },
        centerContainer: function() {
            var offset = (height - $ajaxContainer.height()) / 2;
            $ajaxContainer.parent().css('padding-top', offset);
        },
        deferImages: function() {
            var imgDefer = document.getElementsByTagName('img');
            for (var i = 0; i < imgDefer.length; i++) {
                if (imgDefer[i].getAttribute('data-src')) {
                    imgDefer[i].setAttribute('src', imgDefer[i].getAttribute('data-src'));
                }
            }
        }
    };
    app.init();
});